import { FaShoppingCart } from "react-icons/fa";
import { useSelector } from "react-redux";
import { NavLink } from "react-router-dom";



const Navbar = () => {
const {cart}= useSelector

  return(
    <div>
      <nav className="flex flex-row justify-between items-center h-20 max-w-6xl mx-auto">
          <NavLink to='/'>
            <div className="ml-6">
              <img src="https://upload.wikimedia.org/wikipedia/en/f/f6/Kendrick_Lamar_-_To_Pimp_a_Butterfly.png" className="w-12 h-12"/>  
            </div>
          </NavLink>

          <div className="flex flex-row items-center gap-x-6 mr-6 text-slate-100">
            <NavLink to='/'>
             <p>Home</p>
            </NavLink>
            
            <NavLink to='/cart'>
              <div>
                <FaShoppingCart/>
                <span>{cart.length}</span>
              </div>
            </NavLink>
            
          </div>
      </nav>

    </div>
  )
};

export default Navbar;
